package com.lnho.leetcode.solution;

import org.junit.Assert;
import org.junit.Before;
import org.junit.Test;

import static org.junit.Assert.*;

public class Solution028Test {
    @Test
    public void getNext() throws Exception {
        Assert.assertArrayEquals(solution028.getNext("b"), solution028.getNext2("b"));
        Assert.assertArrayEquals(solution028.getNext("aaa"), solution028.getNext2("aaa"));
        //i=0 next=0
        //i=1 next=0
        //i=2 用1和0比较得到相等，next=1
        Assert.assertArrayEquals(solution028.getNext("ababaca"), solution028.getNext2("ababaca"));
        Assert.assertArrayEquals(solution028.getNext("ababcababcaca"), solution028.getNext2("ababcababcaca"));
        //i=0 next=0
        //i=1 next=0
        //i=2 用a和b比较得到不相等，next=0
        //i=3 用a和a比较得到相等，next=1
        //i=4 用b和b比较得到相等，next=2
        //i=5 用a(2)和a(4)比较，next=3
        //i=6 用b(3)和c（5）比较，不等=》用b(next(3)=1)和和c（5）比较，不等=》用a(next(1))和c（5）比较，不等，由于next(1)=0,不比较了
        Assert.assertArrayEquals(solution028.getNext("abb"), solution028.getNext2("abb"));
        Assert.assertArrayEquals(solution028.getNext("aaaaa"), solution028.getNext2("aaaaa"));
        Assert.assertArrayEquals(solution028.getNext(
                ""), solution028.getNext2(
                ""));
        Assert.assertArrayEquals(solution028.getNext(
                ""), solution028.getNext2(
                ""));

    }

    @Test
    public void getNext3() throws Exception {//        bbbbbbbaa
        Assert.assertArrayEquals(solution028.getNext3("bbbbbbaa"), solution028.getNext2("bbbbbbaa"));
        //i=0 next=0
        //i=1 next=0
        //i=2 用b和b比较得到相等，next=1
        //i=3 用a和a比较得到相等，next=2
        //i=4 用b和b比较得到相等，next=3
        //i=5 用b和b比较得到相等，next=4
        //i=6 用b和b比较得到相等，next=5
        //i=7 用b和b比较得到相等，next=0
    }

    private Solution028 solution028;

    @Before
    public void setUp() throws Exception {
        solution028 = new Solution028();
    }

    @Test
    public void strStr() throws Exception {
        Assert.assertEquals(solution028.strStr("a", "b"), -1);
        Assert.assertEquals(solution028.strStr("ab", "b"), 1);
        Assert.assertEquals(solution028.strStr("acabc", "abc"), 2);
        Assert.assertEquals(solution028.strStr("aaa", "aaa"), 0);
        Assert.assertEquals(solution028.strStr("bbbbbbbbbb", "bbbb"), 0);
        Assert.assertEquals(solution028.strStr("aaa", "aaaa"), -1);
        Assert.assertEquals(solution028.strStr(
                "",
                ""), -1);
        Assert.assertEquals(solution028.strStr(
                "abbabaaaabbbaabaabaabbbaaabaaaaaabbbabbaabbabaabbabaaaaababbabbaaaaabbbbaaabbaaabbbbabbbbaaabbaaaaababbaababbabaaabaabbbbbbbaabaabaabbbbababbbababbaaababbbabaabbaaabbbba",
                "bbbbbbaa"), 118);
    }
}